	(17, 3, 1, 'amarcano568@gmail.com', '2019-11-27 14:11:42.000000', NULL, NULL, NULL, NULL, 1, 129, 0, 'From this distant vantage point, the Earth might not seem of any particular interest. But for us, it\'s different. Consider again that dot. That\'s here. That\'s home. That\'s us. On it everyone you love, everyone you know, everyone you ever heard of, every human being who ever was, lived out their lives. The aggregate of our joy and suffering, thousands of confident religions, ideologies, and economic doctrines, every hunter and forager, every hero and coward, every creator and destroyer of civilization, every king and peasant, every young couple in love, every mother and father, hopeful child, inventor and explorer, every teacher of morals, every corrupt politician, every \\"superstar,\\" every \\"supreme leader,\\" every saint and sinner in the history of our species lived there – on a mote of dust suspended in a sunbeam.</p><p>Here\'s how it is: Earth got used up, so we terraformed a whole new galaxy of Earths, some rich and flush with the new technologies, some not so much. Central Planets, them was formed the Alliance, waged war to bring everyone under their rule; a few idiots tried to fight it, among them myself. I\'m Malcolm Reynolds, captain of Serenity. Got a good crew: fighters, pilot, mechanic. We even picked up a preacher, and a bona fide companion. There\'s a doctor, too, took his genius sister out of some Alliance camp, so they\'re keeping a low profile. You got a job, we can do it, don\'t much care what it is.</p><p>Space, the final frontier. These are the voyages of the starship Enterprise. Its five year mission: to explore strange new worlds, to seek out new life and new civilizations, to boldly go where no man has gone before!</p><p>I am Duncan Macleod, born 400 years ago in the Highlands of Scotland. I am Immortal, and I am not alone. For centuries, we have waited for the time of the Gathering when the stroke of a sword and the fall of a head will release the power of the Quickening. In the end, there can be only one.', 8, 5, NULL, NULL, NULL, NULL),
