)
BEGIN
	select t0.nroTicket, t0.tipo, t1.desTabla, t0.idCategoria, t2.descCategoria, t0.idArea, t3.descArea, 
t0.idSubCategoria, t4.desSubCategoria, t0.idPrbFrecuente, t5.desPrbFrecuente,
