-- Volcando estructura para procedimiento cayro.listar_categoria
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `listar_categoria`(
in AreaIn int ,
in tipoIn int
)
BEGIN
	SELECT t0.idCategoria,t0.descCategoria,t0.idArea,t0.activo,t1.descArea,t2.desTabla,t0.Tipo
	FROM categoria t0 
	inner join area t1  on t0.idArea = t1.idArea 
